</doctype><script>
  var images = document.getElementsByTagName('img');
  
  for (var i = 0; i < images.length; i++) {
    images[i].addEventListener('load', function() {
      // This function is executed when an image successfully loads.
      var filenameWithExtension = this.src.split('/').pop(); // Extract the filename with extension from the image source.
      var filename = filenameWithExtension.split('.')[0]; // Extract the filename without extension.
      
      var container = document.createElement('div'); // Create a <div> container for the image and filename.
      var image = this.cloneNode(); // Clone the image element.
      var filenameElement = document.createElement('p'); // Create a <p> element to display the filename.
      filenameElement.textContent = filename; // Set the text content of the <p> element to the filename.
      
      container.appendChild(image); // Append the cloned image to the container.
      container.appendChild(filenameElement); // Append the <p> element under the container.
      
      // Apply CSS to display elements inline (horizontally).
      container.style.display = 'inline-block';
      
      // Replace the original image with the container.
      this.parentNode.replaceChild(container, this);
    });
    
    images[i].addEventListener('error', function() {
      // This function is executed when an image encounters an error (fails to load).
      this.style.display = 'none'; // Hide the broken image.
    });
  }
</script>
